import React from 'react';
//import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';
import "../css/Cards.css"
import { Link } from 'react-router-dom';
const Cards = (props) => {
    return (
        <div>
            <Card >
      <Card.Img className="card-image" variant="top" src={props.image_url} />
      <Card.Body>
        <Card.Title>{props.medicineName}</Card.Title><hr></hr>
        <Card.Text><h6>Description:</h6>{props.medicineDesc}<hr></hr>
        </Card.Text>
        <Card.Text>
        <h6>price:</h6>{props.price}<hr></hr>
        </Card.Text>
        <Card.Text>
        <h6>ExpirationDate:</h6>{props.expirationDate}
        </Card.Text>
        <Link className="btn btn-dark w-100" to={"/"+props.medicineID}>show Details</Link>
      </Card.Body>
    </Card>
        </div>
    );
};

export default Cards;
